          </div>
          <div className="contactSection__email">
            <i className="far fa-envelope emailIcon"></i>{" "}
            djmateuszswiatczak@gmail.com
          </div>
        </div>
        <div className="PhotoOfTelephone"></div>
      </div>
    </div>
  );
}
